import React from "react";

const Sidebar = (zines) => {
  return (
    <div className="container">
      <div className="sidebar">
        <h2>Index</h2>
        <ul>
          {" "}
          {zines.map((zine, index) => (
            <div key={index}>
              <li>
                {zine.title}, {zine.author}
              </li>
            </div>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default Sidebar;
